import React from 'react';
import { View, Text, StyleSheet } from 'react-native';


export default function MapScreen(){
return (
<View style={styles.container}>
<Text style={styles.title}>MAPA</Text>
<View style={styles.mapPlaceholder}><Text>Mapa interactivo (aqui iria react-native-maps)</Text></View>
</View>
);
}


const styles = StyleSheet.create({
container:{flex:1, alignItems:'center', backgroundColor:'#bfe1ff'},
title:{fontSize:22, marginTop:8, fontWeight:'700'},
mapPlaceholder:{flex:1, width:'94%', marginTop:12, borderRadius:12, backgroundColor:'#e6f0f8', alignItems:'center', justifyContent:'center'}
});
